Information
------------------------------

Asteroid Impact
 Aka Asteroid That Hit Earth
A first in the history of space exploration, recently scientists spotted and tracked an asteroid on a collision course with Earth. About the size of a truck, the asteroid slammed into the Nubian Desert in Sudan, and landed in nearly the exact location and only a few seconds from the time scientists had predicted. In Asteroid Impact, join NASA experts and researchers as they examine the remnants of the asteroid to unlock the clues to help us prevent or simply survive future asteroid impacts.

